export class MetaDataLoader extends Entity {
  _entity: string;
  _field: string;
  _id: string;

  constructor(entity: string, id: string, field: string) {
    super();
    this._entity = entity;
    this._id = id;
    this._field = field;
  }

  load(): MetaData[] {
    let value = store.loadRelated(this._entity, this._id, this._field);
    return changetype<MetaData[]>(value);
  }
}
